svg.script:
var m_element;
var mSVGDoc;
var mSVGRoot;

var scale = 0.65;
var timerMID = null;
var timerMRunning = false;
var showM = true;

function stopMclock(){
    if(timerMRunning)
    clearInterval(timerMID)
    timerMRunning = false
}

function startMclock(){
    // Make sure the clock is stopped
    stopMclock()
    timerMID = setInterval("showSelectedM()",1000)
    timerMRunning = true
}

function showSelectedM(){
	if(showM == true){
		var paramArray = [];
        	if ( document.defaultView.frameElement ) {
			var params = document.defaultView.frameElement.getElementsByTagName("param");

           		for ( var i = 0, iLen = params.length; iLen > i; i++ ) {
				var eachParam = params[ i ];
				var name = eachParam.getAttribute( "name" );
				var value = eachParam.getAttribute( "value" );

				if(value == "selected"){
					setActiveMin(name);
				}
			}
		}
	}
}

function SetMParams() {
		startMclock();
}


function __$(id){
	return document.getElementById(id);
}

function __$__(id){
	return document.defaultView.parent.document.getElementById(id);
}

function setActiveMin(id){
	var controls = ["tm5", "tm10", "tm15", "tm20", "tm25", "tm30", "tm35", "tm40", "tm45", "tm50", "tm55", "tm0"];

	for(var i = 0; i < controls.length; i++){
		__$(controls[i]).style.cssText = "fill-opacity: 1; stroke: rgb(0, 0, 0); stroke-opacity: 1; fill:  #ffffff;";
		if(__$__("e" + controls[i])) __$__("e" + controls[i]).setAttribute("value", "");
	}

	__$(id).style.cssText = "fill-opacity: 1; stroke: rgb(0, 0, 0); stroke-opacity: 1; fill:  #9cdcf1;";

	tstCurrentSelectedMinRange = id.substring(2);

	if(__$__("e" + id)) {
		__$__("e" + id).value = "selected";
	}
}

function RunMinScript(LoadEvent) {
	var time = (new Date()).getMinutes();
	var range = "";

	if(time >= 1 && time <= 5){
		range = 5;
	} else if(time >= 6 && time <= 10){
		range = 10;
	} else if(time >= 11 && time <= 15){
		range = 15;
	} else if(time >= 16 && time <= 20){
		range = 20;
	} else if(time >= 21 && time <= 25){
		range = 25;
	} else if(time >= 26 && time <= 30){
		range = 30;
	} else if(time >= 31 && time <= 35){
		range = 35;
	} else if(time >= 36 && time <= 40){
		range = 40;
	} else if(time >= 41 && time <= 45){
		range = 45;
	} else if(time >= 46 && time <= 50){
		range = 50;
	} else if(time >= 51 && time <= 55){
		range = 55;
	} else if(time >= 56 && time <= 59){
		range = 0;
	} 

	setActiveMin("tm" + range);

	mSVGDoc			= LoadEvent.target.ownerDocument;
	m_element		= mSVGDoc.getElementById("layerMinute");

	setMDimension(566.72*scale,566.72*scale);
         setMScale(scale,scale);
}

function setMDimension(w,h) {
	mSVGDoc.documentElement.setAttribute("width", w);
	mSVGDoc.documentElement.setAttribute("height", h);
}

function setMScale(sw, sh) {
	m_element.setAttribute("transform", "scale(" + sw + " " + sh +")");
}
